Ohne angeben zu wollen, habe ich #Putin schon vor 15 Jahren absolut alles zugetraut. Der Typ war schon immer total skrupellos & hinterliess nur Schutt & Asche. Nun läuft ihm die Zeit davon, seine Pläne wie gewohnt umzusetzen und die #Demokratie rückt näher an #Russland heran. Der offene Überfall auf die #Ukraine ist klar ein Zeichen dafür. Er wird immer brutaler & unberechenbarer werden. Wir sollten uns darauf einstellen & ihn stoppen, bevor der ganze Kontinent hineingezogen wird.

