Ich bin seit über 3 Jahren an #Longcovid erkrankt. Erwerbsminderungsrente mit 31. Es gibt keine offiziellen Therapine. Die Gelder für Grundlagen & Therapieforschung seitens des 
@fdpbt
 geführten 
@BMBF_Bund
 unter 
@starkwatzinger
 sind viel zu wenig. Ich will wieder leben & arbeiten.

#Russland kann diesen Krieg nicht gewinnen - wie auch? Ein riesiges Land mit 40 Mio Einwohnern besetzen??? Die viel grössere UDSSR hielt im weitaus weniger dicht besiedelten & viel geringer überbauten & bewaldeten #Afghanistan gerade mal 8 Jahre durch. Die #Ukraine wird Widerstand leisten - egal wie. Wenn der Westen aber keine Waffen & Munition liefert, werden unendlich mehr #Ukrainer sterben - weil sie dann mit untauglichen Mitteln diesen Krieg weiterführen müssen. LIEFERT WAFFEN!!!
